import React from "react";
import '../style/Card.css'

function Card({ movie }) {
  return (
    <>
      <div>
        <div className="img-card">
        <img src={require('../images/one.jpg')} width={240}/>
        <span>{movie.title}</span>
        </div>
      </div>
    </>
  );
}

export default Card;
